import React, { useState, useContext } from "react";
import { Navbar, Container, Dropdown } from "react-bootstrap";
import log from "../../assets/icons/Icon.png";
import { Link } from "react-router-dom";
import "./navstyle.css";
import LoginMod from "../modals/LoginMod";
import RegisterMod from "../modals/RegisterMod";
import { UserContext } from "../../context/Contextusr";
import icusr from "../../assets/icons/user.png";
import bil1 from "../../assets/icons/bill1.png";
import usr from "../../assets/icons/user2.png";
import logout from "../../assets/icons/logout1.png";

function NavbarComp() {
  const cekuser = JSON.parse(localStorage.getItem("userlogin"));
  const [state] = useContext(UserContext);
  const [modal, setModal] = useState(false);
  const [modReg, setModReg] = useState(false);

  const handleClick = () => {
    setModal(true);
  };
  const handleClickk = () => {
    setModReg(true);
  };

  console.log(state);

  return (
    <>
      <Navbar expand="lg" variant="light" className="navbar" fixed="top">
        <Container>
          <Link to="/" className="log">
            <img src={log} alt="loooddewetour" height="53" />
          </Link>
          <div className="ml-auto">
            {!cekuser ? (
              <>
                <button className="btnlog" onClick={handleClick}>
                  Login
                </button>
                <button className="btnreg" onClick={handleClickk}>
                  Register
                </button>
              </>
            ) : (
              <>
                {cekuser?.status === "admin" ? (
                  <Dropdown>
                    <Dropdown.Toggle id="dropdown-basic">
                      <img src={icusr} alt="dafdsfsap" height="35" />
                    </Dropdown.Toggle>

                    <Dropdown.Menu>
                      <div className="drp">
                        <Link to="/admin/trip" className="tdrp">
                          <img src={usr} alt="dasflpl" className="mr-2" />
                          Trip
                        </Link>
                      </div>
                      <div className="drp">
                        <Link to="/payment" className="tdrp">
                          <img src={bil1} alt="dasflpl" className="mr-2" />
                          Transaction
                        </Link>
                      </div>
                      <hr />
                      <div className="drp">
                        <span className="tdrp">
                          <img src={logout} alt="dasflpl" className="mr-2" />
                          Logout
                        </span>
                      </div>
                    </Dropdown.Menu>
                  </Dropdown>
                ) : (
                  <Dropdown>
                    <Dropdown.Toggle id="dropdown-basic">
                      <img src={icusr} alt="dafdsfsap" height="35" />
                    </Dropdown.Toggle>

                    <Dropdown.Menu>
                      <div className="drp">
                        <Link to="/client/profile" className="tdrp">
                          <img src={usr} alt="dasflpl" className="mr-2" />
                          Profile
                        </Link>
                      </div>
                      <div className="drp">
                        <Link to="/payment" className="tdrp">
                          <img src={bil1} alt="dasflpl" className="mr-2" />
                          Pay
                        </Link>
                      </div>
                      <hr />
                      <div className="drp">
                        <span className="tdrp">
                          <img src={logout} alt="dasflpl" className="mr-2" />
                          Logout
                        </span>
                      </div>
                    </Dropdown.Menu>
                  </Dropdown>
                )}
              </>
            )}
          </div>
        </Container>
      </Navbar>
      <LoginMod handleShow={modal} handleClose={() => setModal(false)} />
      <RegisterMod handleShow={modReg} handleClose={() => setModReg(false)} />
    </>
  );
}

export default NavbarComp;
